import React, { Component } from 'react'
import { Card, Form, Input } from 'antd'
import {
    SmileOutlined
} from '@ant-design/icons';
import LinkButton from '../../../components/LinkButton';

const formItemLayout = {
    labelCol: {
        xs: { span: 24 },
        sm: { span: 5 },
    },
    wrapperCol: {
        xs: { span: 24 },
        sm: { span: 12 },
    },
}

export default class TrainAddUpdate extends Component {
    render() {
        return (
            <div>
                <div>
                    <Card
                        title={<span style={{ fontSize: '30px' }}>新增车次</span>}
                    >
                        <Form {...formItemLayout} colon='false' layout="horizontal">
                            <Form.Item
                                label="车次"
                                style={{ display: 'inline-flex'}}
                            >
                                <Input placeholder="请输入车次" />
                            </Form.Item>
                            <Form.Item
                                label="车次"
                                style={{ display: 'inline-flex'}}
                            >
                                <Input placeholder="请输入车次" />
                            </Form.Item>
                            <Form.Item
                                label="车次"
                            >
                                <Input placeholder="请输入车次" />
                            </Form.Item>
                            <Form.Item
                                label="车次"
                            >
                                <Input placeholder="请输入车次" />
                            </Form.Item>
                        </Form>
                    </Card>
                </div>
            </div>
        )
    }
}
